 using namespace std;
 void Rofyda_Elghadban(){
  #ifndef ONLINE_JUDGE   
    freopen("input.txt", "r", stdin), freopen("output.txt", "w", stdout);
   #endif
    ios_base::sync_with_stdio(false), cin.tie(nullptr), cout.tie(nullptr);
 }

 bool BS(ll n,ll k,vector<ll>&v,ll s){
  ll temp=v[0]+s;
  int counter=1;
  for(int i=1;i<n;i++){
    if(v[i]>=temp){
      temp=v[i]+s;
      counter++;
    }else{
      continue;
    }
  }
  if(counter<=k){
    return true;
  }else{
    return false;
  }
 }

 void solve(){
  ll n,k;
  cin>>n>>k;
  vector<ll>v(n);
  cin(v);
  ll l=0,r=1e9,ans=0;
  while(l<=r){
    ll mid=l+(r-l)/2;
    if(BS(n,k,v,mid)){
      ans=mid;
      r=mid-1;
    }else{
      l=mid+1;
    }
  }
  cout<<ans<<"\n";
 }

 int main(){
  Rofyda_Elghadban(); 
  int t;
  cin>>t;
  while(t--){
    solve();
  }
  // solve();
  return 0;
 }

