//#define int long long
 
using namespace std;
 
using ll = long long;
using ull = unsigned long long;
using ld = long double;
using pii = pair<int, int>;
using pll = pair<ll, ll>;
 
const int mod = 1e9 + 7;
const int LOG = 20;
const int maxn = 1e5 + 5;
const double eps = 1e-9;
 
void setIO() {
    ios_base::sync_with_stdio(false);
    cin.tie(0);
    cout.tie(0);
}
 
struct SegTree {
    int n;
    vector<vector<ll> > tree;
 
    SegTree(int _n) {
        n = _n;
        tree.resize(2, vector<ll>(4*n+5));
    }
 
    void update(int u, int tl, int tr, int pos, int val, int id) {
        if(tl == tr) {
            tree[id][u] = val;
        } else {
            int tm = (tl + tr) / 2;
            if(pos <= tm)
                update(2*u, tl, tm, pos, val, id);
            else
                update(2*u+1, tm+1, tr, pos, val, id);
            tree[id][u] = tree[id][2*u] + tree[id][2*u+1]; 
        }
    }
 
    ll query(int u, int tl, int tr, int l, int r, int id) {
        if(tl > tr || tl > r || l > tr) return 0;
        if(l <= tl && tr <= r) return tree[id][u];
        int tm = (tl + tr) / 2;
        return (query(2*u, tl, tm, l, r, id)
        + query(2*u+1, tm+1, tr, l, r, id)) % mod;
    }
 
    ll query(int t, int l, int r) {
        return query(1, 0, n-1, l, r, t);
    }
 
    void update(int t, int pos, int val) {
        update(1, 0, n-1, pos, val, t);
    }
};
 
int32_t main() {
    setIO();
 
    ll d[2];
    int n;
    cin >> d[0] >> d[1] >> n;
 
    vector<ll> v(n+1);
    vector<int> log_dp(n+2);
    v[0] = -1e18;
    for(int i=1; i<=n; i++) cin >> v[i];
 
    log_dp[1] = 0;
    for(int i=2; i<=n+1; i++) log_dp[i] = log_dp[i/2] + 1;
 
    vector<vector<ll> > table(n+2, vector<ll>(LOG, 1e18));
    for(int i=1; i<=n; i++) table[i][0] = v[i] - v[i-1];
 
    for(int j=1; j<LOG; j++)
        for(int i=0; i+(1<<j)-1<=n; i++)
            table[i][j] = min(table[i][j-1], table[i+(1<<(j-1))][j-1]);
 
    auto sparseQuery = [&](int l, int r) {
        if(l > r) return ll(1e18);
        int len = r-l+1;
        int k = log_dp[len];
        return min(table[l][k], table[r-(1<<k)+1][k]);
    };
 
    ll dp[n+1][2];
    SegTree tree(n+1);
    memset(dp, 0, sizeof(dp));
    dp[0][0] = 1, dp[0][1] = 1;
    tree.update(0, 0, 1);
    tree.update(1, 0, 1);
 
    vector<int> l(2);
    for(int i=1; i<=n; i++) {
        while(l[0]+1 < i && v[i] - v[l[0]+1] >= d[0]) l[0]++;
        while(l[1]+1 < i && v[i] - v[l[1]+1] >= d[1]) l[1]++;
        // cout << "P: " << l[0] << " - " << i << '\n';
        // cout << "B: " << l[1] << " - " << i << '\n';
 
        // cout << "POSITION: " << i << '\n';
         
        for(int j=0; j<2; j++) {
            int pos = i;
            int lp=0, rp=l[j];
 
            while(lp <= rp) {
                int mid = (lp + rp) / 2;
 
                if(mid+2 > i) pos = mid, rp = mid - 1;
                else if(sparseQuery(mid+2, i-1) >= d[1-j]) pos = mid, rp = mid - 1;
                else lp = mid + 1;
            }
 
            // if(j == 0)
            //     cout << "P: " << pos << " " << l[j] << '\n';
            // else
            //     cout << "B: " << pos << " " << l[j] << '\n';
 
            dp[i][j] = tree.query(j, pos, l[j]);
        }
 
        tree.update(0, i, dp[i][0]);
        tree.update(1, i, dp[i][1]);
        // cout << "dp[" << i << "][" << 0 << "]: " << dp[i][0] << '\n';
        // cout << "dp[" << i << "][" << 1 << "]: " << dp[i][1] << '\n';
    }
 
    cout << (dp[n][0] + dp[n][1]) % mod << '\n';
    return 0;
}

* {
  box-sizing: border-box;
}

/* Set a background color */
body {
  background-color: #474e5d;
  font-family: Helvetica, sans-serif;
}

/* The actual timeline (the vertical ruler) */
.timeline {
  position: relative;
  max-width: 1200px;
  margin: 0 auto;
}

/* The actual timeline (the vertical ruler) */
.timeline::after {
  content: '';
  position: absolute;
  width: 6px;
  background-color: white;
  top: 0;
  bottom: 0;
  left: 50%;
  margin-left: -3px;
}

/* Container around content */
.container {
  padding: 10px 40px;
  position: relative;
  background-color: inherit;
  width: 50%;
}

/* The circles on the timeline */
.container::after {
  content: '';
  position: absolute;
  width: 25px;
  height: 25px;
  right: -17px;
  background-color: white;
  border: 4px solid #FF9F55;
  top: 15px;
  border-radius: 50%;
  z-index: 1;
}

/* Place the container to the left */
.left {
  left: 0;
}

/* Place the container to the right */
.right {
  left: 50%;
}

/* Add arrows to the left container (pointing right) */
.left::before {
  content: " ";
  height: 0;
  position: absolute;
  top: 22px;
  width: 0;
  z-index: 1;
  right: 30px;
  border: medium solid white;
  border-width: 10px 0 10px 10px;
  border-color: transparent transparent transparent white;
}

/* Add arrows to the right container (pointing left) */
.right::before {
  content: " ";
  height: 0;
  position: absolute;
  top: 22px;
  width: 0;
  z-index: 1;
  left: 30px;
  border: medium solid white;
  border-width: 10px 10px 10px 0;
  border-color: transparent white transparent transparent;
}

/* Fix the circle for containers on the right side */
.right::after {
  left: -16px;
}

/* The actual content */
.content {
  padding: 20px 30px;
  background-color: white;
  position: relative;
  border-radius: 6px;
}

/* Media queries - Responsive timeline on screens less than 600px wide */
@media screen and (max-width: 600px) {
/* Place the timelime to the left */
  .timeline::after {
    left: 31px;
  }

/* Full-width containers */
  .container {
    width: 100%;
    padding-left: 70px;
    padding-right: 25px;
  }

/* Make sure that all arrows are pointing leftwards */
  .container::before {
    left: 60px;
    border: medium solid white;
    border-width: 10px 10px 10px 0;
    border-color: transparent white transparent transparent;
  }

/* Make sure all circles are at the same spot */
  .left::after, .right::after {
    left: 15px;
  }

/* Make all right containers behave like the left ones */
  .right {
    left: 0%;
  }
}

